  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Union Slough
  NWR outlines Refuge accomplishments from September through December of 1954. The
  report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  raptors, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and vegetation control. Resource management
  is outlined; topics include grazing and fur harvesting. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, fishing, and violations. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
